<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title></title>
</head>

<body>
  <!--begin::Email template-->
  <style>
    html,
    body {
      padding: 0;
      margin: 0;
      font-family: Inter, Helvetica, "sans-serif";
      background-color: #D5D9E2;
    }

    a:hover {
