                    Order Number: {invoice_number}
                  </p>
                  <p style="margin-bottom:2px; color:#5E6278">
                    Date of Invoice: {invoice_date}
                  </p>
                  <p style="margin-bottom:2px; color:#5E6278">
                    Tracking Number: {tracking_number}
                  </p>
                  <p style="margin-bottom:2px; color:#5E6278">
                    Your prompt payment ensures that your order will be shiiped on time, and we appreciate your commitment to a smooth
                    transaction. We trust that you'll be delighted with your purchase.
                  </p>
                  <p style="margin-bottom:2px; color:#5E6278"></p>
          <tr>
